import React from 'react';
import './App.css';
import Main from './components/Main';

function App(props) {
  return (
    <div className="App">
      <header className="App-header">
        <p>
          Hello {props.name}
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
      <Main />
    </div>
  );
}

export default App;
